const Content = ({ handleChange, handleDelete, items }) => {
  
  return <>{items.length ? 
  <Itemlist 
    handleChange={handleChange} 
    handleDelete={handleDelete}
    items={items}  
  /> : 
  <p>Your List is Empty</p>}</>;
};
export default Content;
